$(document).ready(function(){var createFinalPDF=function(){var element=$('#map');var pdfOptions={orientation:"landscape",unit:"mm",format:"letter"};var pdf=new jsPDF(pdfOptions);var pageWidth=pdf.internal.pageSize.width-20;var width=pageWidth;html2canvas(element,{useCORS:true,onrendered:function(canvas){var imgWidth=element.width();var imgHeight=element.height();var height=(pageWidth*imgHeight)/imgWidth
var imgData=canvas.toDataURL('image/png');pdf.addImage(imgData,'PNG',10,10,width/1.5,height/1.5);pdf.save('new.pdf');}});}
$("#createPDF").on('click',function(){console.log('printing....');createFinalPDF();});});